    I&#x2019;m Becca - nearly finished my Master&#x2019;s in Marketing and about to take my business full time &#x1f393;&#x1f4bb;
    But it hasn&#x2019;t been a straight path&#x2026;
    
    I studied Law for 5 years before realising it wasn&#x2019;t for me. I felt so much pressure to have it all figured out, and honestly? I was lost.
    
    So after taking a year out, I went back to uni 
    - not because I wanted to, but because it felt like the only option I had.
    
    I knew I was made for more than the 9-5 routine everyone told me was &#x201c;normal.&#x201d;
    I&#x2019;ve always dreamed of being my own boss and living a life with freedom, travel and purpose - but had no idea how.

    I&#x2019;ve always loved to travel, to chat, to create, to connect.
    But being a student, travel didn&#x2019;t feel accessible.
    And content creation felt like just a hobby.
    
    Now? I&#x2019;ve combined it all - I travel more than ever, I get paid to create content (sometimes even for hotels&#x1f440;), and I&#x2019;ve built a business I love, with the most amazing community of girls who&#x2019;ve become my best friends &#x1f9e1;
    
    It hasn&#x2019;t always been easy - building a business is hard.
    But so is working for someone else for the rest of your life.
    So I chose my own hard. And I backed myself.
    
    Now I&#x2019;m hosting calls, dancing around at photoshoots, working from anywhere in the world - and doing it all with the confidence I never knew I had &#x2728;
    
    If you&#x2019;ve ever felt lost, like you&#x2019;re meant for more, or like life has to be better than what we&#x2019;ve been taught to accept&#x2026;

    Because your life doesn&#x2019;t have to stay the same. You just have to be brave enough to change it.

,"social_context":[],"can_reshare":null,"enable_media_notes_production":false,"saved_collection_ids":null,"has_viewer_saved":null,"sharing_friction_info":{"should_have_sharing_friction":false,"bloks_app_url":null},"caption":{"text":"It\u2019s been a crazy few months and with so many new faces around here, I thought it was time I shared my story again \ud83e\udd0d\n\nI\u2019m Becca - nearly finished my Master\u2019s in Marketing and about to take my business full time \ud83c\udf93\ud83d\udcbb\nBut it hasn\u2019t been a straight path\u2026\n\nI studied Law for 5 years before realising it wasn\u2019t for me. I felt so much pressure to have it all figured out, and honestly? I was lost.\n\nSo after taking a year out, I went back to uni \n- not because I wanted to, but because it felt like the only option I had.\n\nI knew I was made for more than the 9-5 routine everyone told me was \u201cnormal.\u201d\nI\u2019ve always dreamed of being my own boss and living a life with freedom, travel and purpose - but had no idea how. \n\nAnd then I found this opportunity.\n\nAt the time, I didn\u2019t overthink it. I said yes straight away - and I\u2019ve never looked back.\nI\u2019ve always loved to travel, to chat, to create, to connect.\nBut being a student, travel didn\u2019t feel accessible.\nAnd content creation felt like just a hobby.\n\nNow? I\u2019ve combined it all - I travel more than ever, I get paid to create content (sometimes even for hotels\ud83d\udc40), and I\u2019ve built a business I love, with the most amazing community of girls who\u2019ve become my best friends \ud83e\udde1\n\nIt hasn\u2019t always been easy - building a business is hard.\nBut so is working for someone else for the rest of your life.\nSo I chose my own hard. And I backed myself.\n\nNow I\u2019m hosting calls, dancing around at photoshoots, working from anywhere in the world - and doing it all with the confidence I never knew I had \u2728\n\nIf you\u2019ve ever felt lost, like you\u2019re meant for more, or like life has to be better than what we\u2019ve been taught to accept\u2026\nThis is your sign.\n\n\ud83d\udce9 Comment DREAM and I\u2019ll show you exactly how I made the switch - and how you can too \ud83e\udd0d\nBecause your life doesn\u2019t have to stay the same. You just have to be brave enough to change it. \n\n#onlinebusiness #remote #remoteworklife #girlboss #entrepreneur #dreamlife #dreamlifestyle #contentcreator #financialfreedom","pk":"18097079818594797","has_translation":null,"created_at":1751562771},"boosted_status":null,"boost_unavailable_identifier":null,"boost_unavailable_reason":null,"can_see_insights_as_brand":false,"affiliate_info":null,"main_feed_carousel_starting_media_id":null,"ig_media_sharing_disabled":false,"feed_demotion_control":null,"feed_recs_demotion_control":null,"is_shared_from_basel":null,"fb_comment_count":null,"all_previous_submitters":null,"follow_hashtag_info":null,"media_attributions_data":[],"wearable_attribution_info":null,"caption_is_edited":false,"commenting_disabled_for_viewer":null}]}},"extensions":{"is_final":true,"all_video_dash_prefetch_representations":[]}},"sequence_number":0}}]],["CometResourceScheduler","registerHighPriHashes",null,[["rzJa7sw","1QqZdJY"]]]]}},{"__bbox":null},{"__bbox":null}]]]}</script>

    <script type="application/json"  data-content-len="443887" data-sjs>{"require":[["ScheduledServerJS","handle",null,[{"__bbox":{"require":[["RelayPrefetchedStreamCache","next",[],["adp_PolarisDesktopPostPageRelatedMediaGridQueryRelayPreloader_68f6f59ec06913352353073",{"__bbox":{"complete":true,"result":{"data":{"xdt_api__v1__profile_timeline":{"num_results":7,"items":[{"pk":"3668696882176581653","accessibility_caption":"Photo by Becca Campbell | Online Business Coach \ud83e\udef6\ud83c\udffc in Glasgow, United Kingdom.","caption":{"pk":"18097079818594797","text":"It\u2019s been a crazy few months and with so many new faces around here, I thought it was time I shared my story again \ud83e\udd0d\n\nI\u2019m Becca - nearly finished my Master\u2019s in Marketing and about to take my business full time \ud83c\udf93\ud83d\udcbb\nBut it hasn\u2019t been a straight path\u2026\n\nI studied Law for 5 years before realising it wasn\u2019t for me. I felt so much pressure to have it all figured out, and honestly? I was lost.\n\nSo after taking a year out, I went back to uni \n- not because I wanted to, but because it felt like the only option I had.\n\nI knew I was made for more than the 9-5 routine everyone told me was \u201cnormal.\u201d\nI\u2019ve always dreamed of being my own boss and living a life with freedom, travel and purpose - but had no idea how. \n\nAnd then I found this opportunity.\n\nAt the time, I didn\u2019t overthink it. I said yes straight away - and I\u2019ve never looked back.\nI\u2019ve always loved to travel, to chat, to create, to connect.\nBut being a student, travel didn\u2019t feel accessible.\nAnd content creation felt like just a hobby.\n\nNow? I\u2019ve combined it all - I travel more than ever, I get paid to create content (sometimes even for hotels\ud83d\udc40), and I\u2019ve built a business I love, with the most amazing community of girls who\u2019ve become my best friends \ud83e\udde1\n\nIt hasn\u2019t always been easy - building a business is hard.\nBut so is working for someone else for the rest of your life.\nSo I chose my own hard. And I backed myself.\n\nNow I\u2019m hosting calls, dancing around at photoshoots, working from anywhere in the world - and doing it all with the confidence I never knew I had \u2728\n\nIf you\u2019ve ever felt lost, like you\u2019re meant for more, or like life has to be better than what we\u2019ve been taught to accept\u2026\nThis is your sign.\n\n\ud83d\udce9 Comment DREAM and I\u2019ll show you exactly how I made the switch - and how you can too \ud83e\udd0d\nBecause your life doesn\u2019t have to stay the same. You just have to be brave enough to change it. \n\n#onlinebusiness #remote #remoteworklife #girlboss #entrepreneur #dreamlife #dreamlifestyle #contentcreator #financialfreedom"},"audience":null,"carousel_media_count":null,"display_uri":null,"media_type":1,"carousel_media":null,"image_versions2":{"candidates":[{"height":1688,"url":"https:\/\/scontent-mia3-2.cdninstagram.com\/v\/t51.82787-15\/515056302_18516926290056259_8356572849995127983_n.jpg?stp=dst-jpg_e35_tt6&_nc_cat=105&ig_cache_key=MzY2ODY5Njg4MjE3NjU4MTY1Mw\u00253D\u00253D.3-ccb1-7&ccb=1-7&_nc_sid=58cdad&efg=eyJ2ZW5jb2RlX3RhZyI6InhwaWRzLjEzNTB4MTY4OC5zZHIuQzMifQ\u00253D\u00253D&_nc_ohc=A7njGBJjkWMQ7kNvwGQvQT9&_nc_oc=AdneVkOej4oj638LenSHsb24Wl-ShlZSQD3hR_xvQMXXikij_ye_HHWAQRONSpbYs2Y2lG1k7kc2fvYpGY5g4Aku&_nc_ad=z-m&_nc_cid=0&_nc_zt=23&_nc_ht=scontent-mia3-2.cdninstagram.com&_nc_gid=WoLUmDBpQlhY2y7NH-xPUw&oh=00_AffiVI9SSgl1g5vPibGTabulawkVht2wMCV6VGzWQgCP7A&oe=68FCC5DB","width":1350},{"height":1350,"url":"https:\/\/scontent-mia3-2.cdninstagram.com\/v\/t51.82787-15\/515056302_18516926290056259_8356572849995127983_n.jpg?stp=dst-jpg_e35_p1080x1080_tt6&_nc_cat=105&ig_cache_key=MzY2ODY5Njg4MjE3NjU4MTY1Mw\u00253D\u00253D.3-ccb1-7&ccb=1-7&_nc_sid=58cdad&efg=eyJ2ZW5jb2RlX3RhZyI6InhwaWRzLjEzNTB4MTY4OC5zZHIuQzMifQ\u00253D\u00253D&_nc_ohc=A7njGBJjkWMQ7kNvwGQvQT9&_nc_oc=AdneVkOej4oj638LenSHsb24Wl-ShlZSQD3hR_xvQMXXi
